import React from "react";
import Record from "./db.json";
const Home = () => {

  return (
    <>
      <div className="container">
        <table>
        {Record.map((value)=>
        {
            return <tr>
            <th>Company</th>
            <th>Contact</th>
            <th>Country</th>
          </tr>
        })}
        </table>
      </div>
    </>
  );
};

export default Home;
